tables.table_schema:
CREATE TABLE trade_partners (
    partner_id INT PRIMARY KEY,
    partner_name VARCHAR(100) NOT NULL,
    partner_location VARCHAR(100) NOT NULL
);

CREATE TABLE trade_patterns (
    pattern_id INT PRIMARY KEY,
    pattern_description TEXT NOT NULL
);

CREATE TABLE traders ( 
   trader_id INT PRIMARY KEY, 
   trader_name VARCHAR(50), 
   trader_location VARCHAR(50) 
);

CREATE TABLE trade_partners (
    partner_id INT PRIMARY KEY,
    partner_name VARCHAR(100),
    country VARCHAR(50),
    industry VARCHAR(50)
);

CREATE TABLE trade_categories (
    category_id INT PRIMARY KEY,
    category_name VARCHAR(50)
);

CREATE TABLE trade_locations (
    location_id INT PRIMARY KEY,
    location_name VARCHAR(100),
    latitude DECIMAL(9, 6),
    longitude DECIMAL(9, 6)
);
